INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 0.0, 1, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 110501, 24, "2019/07/31 12:00:00", 24015, 4, 0.0, 4, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 4.0, 2, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 110501, 24, "2019/07/31 12:00:00", 24016, 1, 0.0, 4, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 0.0, 3, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 110501, 24, "2019/07/31 12:00:00", 24017, 4, 0.0, 4, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 5.2, 4, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 110501, 24, "2019/07/31 12:00:00", 24018, 2, 0.0, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 4.2, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 110501, 24, "2019/07/31 12:00:00", 24019, 6, 0.0, 5, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 0.0, 6, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 110501, 24, "2019/07/31 12:00:00", 24020, 2, 0.0, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 6.4, 7, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 110501, 24, "2019/07/31 12:00:00", 24021, 6, 0.0, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 0.0, 8, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 110501, 24, "2019/07/31 12:00:00", 24022, 2, 0.0, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 10.08, 9, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 110501, 24, "2019/07/31 12:00:00", 24023, 3, 0.0, 6, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 5.0, 10, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 110501, 24, "2019/07/31 12:00:00", 24024, 2, 0.0, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES ("カオリ（サマー）", 10021, 0.0, 0.0, 11, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 110501, 24, "2019/07/31 12:00:00", 24025, 2, 0.0, 2, "2030/12/17 14:59:59");
